package com.citi.retail.optima.etl.common.model.cache;

public class SourceProductDomain {

	private Long prodTypId;
	private String srcProd1;
	private String srcProd2;
	private String srcProd3;

	public Long getProdTypId() {
		return prodTypId;
	}

	public void setProdTypId(Long prodTypId) {
		this.prodTypId = prodTypId;
	}

	public String getSrcProd1() {
		return srcProd1;
	}

	public void setSrcProd1(String srcProd1) {
		this.srcProd1 = srcProd1;
	}

	public String getSrcProd2() {
		return srcProd2;
	}

	public void setSrcProd2(String srcProd2) {
		this.srcProd2 = srcProd2;
	}

	public String getSrcProd3() {
		return srcProd3;
	}

	public void setSrcProd3(String srcProd3) {
		this.srcProd3 = srcProd3;
	}

}
